const vec2 v5 = vec2(0.001,1.0);
uniform sampler2D v6;
const ivec2 v7 = ivec2(1,1);
const vec2 v8 = vec2(1.0,1.0);

void main() {
    float y;

    ivec4 variable_position_y = (convert_position_fast(gl_FragCoord.yx,v0, v1, v2, 0));    

float x0 = texture2D(v3, ((vec2((convert_position_fast(variable_position_y,v1, v4, v0, 0))) + 0.5) * v5)).r;
ivec4 variable_position_x1 = mod(variable_position_y, v1);
float x1 = texture2D(v6, ((vec2((convert_position_fast(variable_position_x1,v1, v7, v7, 0))) + 0.5) * v8)).r;
y = x0 / x1;

